import React from "react";
import "./BasicImage_alt.css";

function BasicImage_alt(props) {
  const { basicImage_Alt } = props;

  return (
    <div className="basic-imagealt">
      <img className="basic-imagealt-1" src={basicImage_Alt} />
    </div>
  );
}

export default BasicImage_alt;
